<template>
    <div>
        <h1>Hello Button</h1>
        <input type="text" placeholder="enter your name" v-model="signup.username"/> <br><br>
        <input type="password" placeholder="enter your password"/> <br><br>

        <p>Choose Hobbies</p>
        <input type="checkbox" id="circket" value="circket"/>
        <label for="circket"> Circket
        </label>

        <input type="checkbox" id="football" value="football"/>
        <label for="football"> Football
        </label>
        <br><br>
        <p>Select Gender</p>
        <input type="radio" id="male" value="male"/>
        <label for="circket"> Male
        </label>

        <input type="radio" id="female" value="female"/>
        <label for="female"> Female
        </label>
    </div>
</template>

<script>
export default{
    name : "ClickButton",
    data(){
        return{
            signup:{
                username:null,
                password:null,
                hobbies:[],
                gender:null
            }
        }
    }
}
</script>
